import React from 'react';

import './menu.css'

function SideBar({items}){
  return (
    <ul disablePadding dense>
      {items.map(({ label, name, ...rest }) => (
      <li button key={name} button {...rest}>
        <a>{label}</a>
      </li>
      // <li button>
      //   <a>Billing</a>
      // </li>
      // <li button>
      //   <a>Settings</a>
      // </li>
      ))}
    </ul>
  )
}

export default SideBar
